Detrás de estos videos hay una cantidad de tiempo invertida bastante grande, no solo en tiempo de grabación sino en edición y renderizacion, así que disfrútenlo! 
Y si desean que estas dos PROS del makeup les enseñen, INSCRÍBANSE en nuestros cursos ✨

